// 在此江湖之中，有道高僧名曰快排，习得一门绝世武学，号称“快速排序”
function quickSort(arr) {
  // 若江湖群雄寡不敌众，高僧便以静制动，孤身隐遁
  if (arr.length <= 1) return arr;

  // 高僧修行多年，心中自有一尊，号“枢”
  const pivot = arr[0];
  // 左手阴阳，化敌为兄，助掌一派之霸业
  const left = [];
  // 右手平衡，化敌为友，共创江湖之太平
  const right = [];

  // 江湖中人，为各自理想，左赴右往，纷纷投奔于枢下
  for (let i = 1; i < arr.length; i++) {
    // 若遇心性善良且武功未至枢者，便纳入左派阵营
    if (arr[i] < pivot) {
      left.push(arr[i]);
    } else {
      // 否则，收于右派，尽显其才
      right.push(arr[i]);
    }
  }

  // 在群侠各显神通后，高僧再使绝学，左右并合，天下归一
  return [...quickSort(left), pivot, ...quickSort(right)];
}
